import * as React from "react";
import styled from "styled-components/native";
import Divider from "src/commons/components/atoms/divider";
import { colors, metrics } from "src/styles";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import { Creators as BooksCreators } from "src/store/ducks/books_list";

interface Props {
  navigation?: any;
  getBooks?: Function | undefined;
}
interface State {}

class HomeScreen extends React.Component<Props, State> {
  static navigationOptions = {
    header: null
  };

  state = {
    input: ""
  };

  navigateToList = () => {
    if (!this.state.input.trim().length) return;
    this.props.getBooks(this.state.input);
    this.props.navigation.navigate("List", { search: this.state.input });
  };

  handleInput = input => this.setState({ input });

  render() {
    console.tron.log("PROPS: ", this.props);
    return (
      <Container>
        <BackgroundImage source={{ uri: link }} resizeMode="stretch" />
        <Content>
          <Title>Google Books</Title>
          <SubTitle>Comece pesquisando alguns livros que deseja</SubTitle>

          <Divider size={30} />

          <Row>
            <Input onChangeText={this.handleInput} clearButtonMode="always" />
          </Row>
          <Row>
            <Button onPress={this.navigateToList}>
              <TextButton>Search</TextButton>
            </Button>
          </Row>
        </Content>
      </Container>
    );
  }
}

const mapStateToProps = state => ({});

const mapDispatchToProps = dispatch =>
  bindActionCreators(BooksCreators, dispatch);

export default connect(
  null,
  mapDispatchToProps
)(HomeScreen);

const BackgroundImage = styled.Image`
  width: 100%;
  height: 100%;
  position: absolute;
  top: 0;
  left: 0;
  opacity: 0.3;
`;

const Container = styled.SafeAreaView`
  flex: 1;
  background-color: ${colors.primary};
  align-items: center;
`;

const Content = styled.View`
  padding: 10px;
  justify-content: center;
  align-items: center;
  flex: 1;
  top: -100px;
`;

const Row = styled.View`
  flex-direction: row;
`;

const Title = styled.Text`
  padding: 10px;
  font-weight: 700;
  font-family: Roboto-Bold;
  font-size: 25px;
  margin-bottom: ${metrics.baseMargin}px;
`;

const SubTitle = styled.Text`
  font-weight: 600;
  font-family: Roboto-Medium;
  font-size: 18px;
  margin-bottom: ${metrics.baseMargin}px;
`;

const Input = styled.TextInput.attrs({
  placeholder: "search books",
  autoCapitalize: "none",
  autoCorrect: false,
  underlineColorAndroid: "transparent"
})`
  max-width: 250px;
  background-color: white;
  border-radius: 5px;
  font-weight: 400;
  font-size: 16px;
  padding: 5px 10px;
  margin-bottom: ${metrics.baseMargin}px;
  flex: 1;
`;

const Button = styled.TouchableOpacity`
  max-width: 250px;
  background-color: ${colors.button};
  border-radius: 5px;
  justify-content: center;
  flex-direction: row;
  padding: 10px 30px;
  margin-bottom: ${metrics.baseMargin}px;
  flex: 1;
`;

const TextButton = styled.Text`
  color: white;
  font-weight: 500;
  font-family: Roboto-Regular;
  font-size: 16px;
`;

const link = `data:image/jpeg;base64,`;
